import React from "react";

const Score = ({ scoreBlack, scoreWhite }) => {
  return (
    <div className="scores-container">
      <h3>Scores</h3>
      <div className="score">
        <p>
          <strong>Player:</strong> {scoreBlack}
        </p>
        <p>
          <strong>Bot:</strong> {scoreWhite}
        </p>
      </div>
    </div>
  );
};

export default Score;
